import React from "react";
import "./Footer.css";

const Footer = () => {
    return (
        <div className="footer-container">
            <a
                target="_blank"
                className="footer-link"
                href="https://github.com/vanishapatwari"
                rel="noreferrer"
            >
                Watch the full react course now!
            </a>
        </div>
    );
};

export default Footer;
